const LOAD_PRODUCTS = 'LOAD_PRODUCTS'

export const loadProductsAction = payload => ({type: LOAD_PRODUCTS, payload}) 

export const Products_reducer = (state = [], action) => {
    if (action.type === LOAD_PRODUCTS) {
        return action.payload
    } else return state
}
